import { useState } from 'react'
import './Form.css';

const Form = (props) => {
    const [checked, setChecked] = useState(true)

    return (
        <div className="Form">
            <div>
                <label>Select Your Favorite Genres</label>
                <label>
                    <input type="checkbox"
                        defaultChecked={checked}
                        onChange={() => setChecked(!checked)}
                    />
                    Check Me!
                </label>
            </div>
            <div>
                <label>Give a Price Range</label>
            </div>
        </div>
    )
}

export default Form;
